import React, { Component } from 'react'
import './about.css';
import Navbar from '../navbar/Navbar';
import Footer from '../footer/Footer';

export class About extends Component {
    render() {
        return (
            <React.Fragment>
                <Navbar />
                <div className='about-page'>
                    <h3>About Us</h3>
                    <hr />
                    <div className='about-div'>
                        <p>Our team at General Discount Cleaning takes commitment in achieving and maintaining high level of standards in the cleaning industry. We cooperate with successful organizations to reach our goals of creating clean and environment that we all share together. We give our staff necessary training and tools to help guide them to meet all expectations while maintaining high level of customer satisfaction.
                        <br /><br />
                        We offer our clients an array of services in a wide range of facilities including Building and Condo, Offices, Healthcare, Commercial and Building and Specialty services. Xquisit has the right team to provide the highest level of service, we work with every customer to assess the needs of each facility. We develop a customized service program with systems that will ensure a smooth transition and achieve the highest level of service and professionalism. Our team recognizes the importance that green products have become an essential part of the facility industry, Xquisit gives you peace of mind that your environment is clean and safe.</p>
                        <img className='about-image' />
                    </div>
                </div>
                <Footer />
            </React.Fragment>
        )
    }
}

export default About
